import React from 'react';
import { useState } from 'react';
import './Search.css';

const Search = () => {

    const [count, setcount] = useState(0)
    function update(){
        setcount(count+1);
    }
    console.log('component render');

    return(
        <div className="container1">
        <img src="./images/food-wallpaper.png" alt="" className="mainimg"/>
        <div className="logo">
            <div className="roter">
                <img src="./images/healthy-plate_meals.jpg" alt=""/>
                <h3>HI</h3>
            </div> 
        </div>
        <div className="heading">
            Find Best Place Near You {count}
        </div>
        <button on>click</button>
        <div className="dropdown">
            <select>
                <option>-----SELECT YOUR CITY-----</option>
                <option>Hyderabad</option>
                <option>Chennai</option>
                <option>Tirupati</option>
                <option>Vishakapatnam</option>
                <option>Vizianagaram</option>
            </select>
            <select>
                <option>-----SELECT YOUR RESTAURANTS-----</option>
                <option>Wow Momos</option>
                <option>KFC</option>
                <option>Mc Donals</option>
                <option>SubWay</option>
                <option>Pret A Manger</option>
            </select>
        </div>
    </div>
    )
}
export default Search;
